import { Fragment } from 'react';
import './App.css';
import Home from './Components/Home/Home';

function App() {
  return (
    <Fragment>
      <h1>Portafolio</h1>
      <Home />
      <Studies />
      <Experience />
      <Projects />
      <Contact />
      <Login />
    </Fragment>
  );
}

export default App;
